import React, { useEffect } from "react";
import { observer } from "mobx-react-lite";
import disciplineStore from "../store/DisciplineStore";

const DisciplineList = observer(() => {
  const { disciplines, isLoading, error, fetchDisciplines } = disciplineStore;

  useEffect(() => {
    fetchDisciplines();
  }, [fetchDisciplines]);

  if (isLoading) return <p>Loading disciplines...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div>
      <h1>Disciplines</h1>
      <ul>
        {disciplines((discipline) => (
          <li key={discipline.id}>
            <img src={discipline.image} alt={discipline.name} />
            {discipline.name}
          </li>
        ))}
      </ul>
    </div>
  );
});

export default DisciplineList;
